import React, { Component } from 'react'
import { makeStyles } from '@material-ui/core/styles'
import './Portfolio.css'
import Footer from './Footer'
import { Card, CardActions, CardContent, Typography, Button } from '@material-ui/core'


const useStyles = makeStyles({
    root: {
      width: '20rem',
      height: '15rem',
      background: '#2b2d42',
      opacity: '.8'
    },
    bullet: {
      display: 'inline-block',
      margin: '0 2px',
      transform: 'scale(0.8)',
    },
    title: {
      fontSize: 14,
    },
    pos: {
      marginBottom: 12,
    },
    yellow: {
        color: '#fca311'
    }
  });

export default function Portfolio() {
    const classes = useStyles();
    const bull = <span className={classes.bullet}>•</span>;

    return (
        <div className='portfolioContainer'>
            <Card className={classes.root}>
                <CardContent elevation={3} >
                    <Typography component="h4" variant="h4" color="textSecondary" gutterBottom>Music World</Typography>
                    <Typography variant="caption">HTML / JS / API</Typography>
                    <Typography variant="body1">A website that allows you to find your favorite artist's social media pages as well as a few random songs.</Typography>
                </CardContent>
                <CardActions>
                    <Button className={classes.yellow} size="small">Website</Button>
                    <Button className={classes.yellow} size="small">Github</Button>
                </CardActions>
            </Card>
            <Card className={classes.root}>
                <CardContent>
                    <Typography variant="h4" color="textSecondary" gutterBottom>MCTS</Typography>
                    <Typography variant="caption" >React / API</Typography>
                    <Typography variant="body1">A website that allows you to find ACS centers in NYC via borough.</Typography>
                </CardContent>
                <CardActions>
                    <Button size="small">Website</Button>
                    <Button size="small">Github</Button>
                </CardActions>
            </Card>
            <Card className={classes.root}>
                <CardContent>
                    <Typography variant="h4" color="textSecondary" gutterBottom>Expedia Eco-Friendly Clone</Typography>
                    <Typography variant="caption" >React</Typography>
                    <Typography variant="body1">This is a remake of the Expedia website with eco-friendly options.</Typography>
                </CardContent>
                <CardActions>
                    <Button size="small">Website</Button>
                    <Button size="small">Github</Button>
                </CardActions>
            </Card>
            <Card className={classes.root}>
                <CardContent>
                    <Typography variant="h4" color="textSecondary" gutterBottom>Marshall Hub</Typography>
                    <Typography variant="caption" >React</Typography>
                    <Typography variant="body1">A website that allows you to view and post peoples life incidents or your own.</Typography>
                </CardContent>
                <CardActions>
                    <Button size="small">Website</Button>
                    <Button size="small">Github</Button>
                </CardActions>
            </Card>
        </div>
    )
}







